import React, { useState, useEffect, useRef } from "react";
import axios from "axios";
import './row-slider.css'

const RowSlider = () => {
  const [waterBrands, setWaterBrands] = useState([]);

  useEffect(() => {
    axios.get("http://3.39.164.17:8000/waterbrand/").then((response) => {
      setWaterBrands(response.data);
    });
  }, []);

  return (
    <div>
      <button className='rowSliderButtonLeft'></button>
      <button className='rowSliderButtonRigth'></button>
      {waterBrands.map((waterBrand) => (
        <img
          key={waterBrand.id}
          src={waterBrand.image_url}
          alt={waterBrand.name}
          style={{ width: "50px", height: "50px" }}
        />
      ))}
    </div>
  );
};

export default RowSlider;
